from typing import List


class Solution:
    def __init__(self):
        self.memo = {}
    
    def maximalSquare_dp(self, matrix: List[List[str]]) -> int:
        if not matrix or not matrix[0]:
            return 0
        
        n, m = len(matrix), len(matrix[0])
        dp = [[0 for _ in range(m)] for _ in range(n)]
        for i in range(n):
            dp[i][0] = int(matrix[i][0])
        for j in range(m):
            dp[0][j] = int(matrix[0][j])

        max_len = int(any(dp[0]+[dp[i][0] for i in range(i)]))
        for i in range(1, n):
            for j in range(1, m):
                if matrix[i][j] == '1':
                    dp[i][j] = min(dp[i-1][j-1], dp[i-1][j], dp[i][j-1])+1
                    max_len = max(max_len, dp[i][j])

        return max_len * max_len


    def maximalSquare(self, matrix: List[List[str]]) -> int:
        '''
        20191016
        常规思路, 超时, 66/68
        '''
        if not matrix or not matrix[0]:
            return 0
        
        matrix_int = [[int(item) for item in row] for row in matrix]
        n, m = len(matrix), len(matrix[0])
        max_length = min(n, m)
        for length in range(max_length, 0, -1):
            area = length * length

            for i in range(n+1-length):
                for j in range(m+1-length):
                    cur_area = self.area(matrix_int, i, j, length)
                    if cur_area == area:
                        return area
        return 0

    def area(self, matrix, i, j, length):
        area = 0
        for x in range(i, i+length):
            cur_len = self.length(matrix, x, j, length)
            if cur_len < length:
                return -1
            area += cur_len
        return area
    
    def length(self, matrix, i, j, length):
        hash = ';'.join(map(str, [i, j, length]))
        if hash not in self.memo:
            self.memo[hash] = sum(matrix[i][y] for y in range(j, j+length))
        return self.memo[hash]


